import React, { Component } from 'react'
import axios from 'axios'

export default class ItemDetail extends Component {
    static async getInitialProps({ query }) {
        console.log(query)

        return {
            title: 'cc'
        }
    }

    render() {
        console.log(this.props)
        return (
            <div>
                {this.props.title}
                <p>aaaa</p>
            </div>
        )
    }
}
